package JavaConcepts;

public class Nested_If_Example {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	
		String Gender1="F";
		String Gender2="M";
				
		if(Gender1=="F")
		{  
			System.out.println("Ticket Cost is 10");
		}
			
		else if(Gender2=="M")
	    {    
            System.out.println("Ticket Cost is 20");
        } 
	          
		else
		{  
			System.out.println("Ticket cost is 30");
	    }  
	} 
}  